  def check_collision_bomb(self, rect):
    xidx = rect.x // 40
    yidx = rect.y // 40

    for y in range(2):
      for  x in range(2):
        self.now_tile = self.data[yidx + y][xidx + x]
        if self.now_tile == 1:
          if self.data[yidx + y][xidx + x] and rect.colliderect(pygame.Rect
          ((xidx + x) * 40, (yidx + y) * 40, 40, 40)):
            return True,False
        elif self.now_tile == 2:
          if self.data[yidx + y][xidx + x] and rect.colliderect(pygame.Rect
          ((xidx + x) * 40, (yidx + y) * 40, 40, 40)):
            return True,True

    return False, False


